tables.table_schema:
CREATE TABLE kpi_reports (
    report_id INT PRIMARY KEY,
    on_time_delivery_rate DECIMAL,
    order_fulfillment_rate DECIMAL,
    report_date DATE
);

CREATE TABLE on_time_deliveries (
    order_id INT PRIMARY KEY,
    delivery_date DATE,
    customer_id INT,
    delivery_status VARCHAR(255)
);

CREATE TABLE order_fulfillment_rates (
    order_id INT PRIMARY KEY,
    fulfillment_rate DECIMAL(5,2),
    fulfillment_date DATE,
    customer_id INT
);

CREATE TABLE Reports (
    report_id SERIAL PRIMARY KEY,
    report_name VARCHAR(255) NOT NULL,
    delivery_rate FLOAT NOT NULL,
    fulfillment_rate FLOAT NOT NULL
);

CREATE TABLE Deliveries (
    delivery_id SERIAL PRIMARY KEY,
    order_id INT NOT NULL,
    delivery_date DATE NOT NULL,
    delivery_status VARCHAR(50) NOT NULL
);
